import React from "react";

export default function Header(props: any){
    return(
        <header>
            <div>
                <a href="#/">
                    <h1>Shopping</h1>
                </a>
            </div>
            <div>
                <a href="#/cart">Cart</a>
            </div>
        </header>
    )
}
